#!/bin/bash
main(){
	skip_rownum=$(awk '/^#__BIN_FILE_BEGIN__/ {print NR + 1; exit 0; }' "$0")
	shname=/tmp/installb_redis.sh
	tmpname=/tmp/installb_file
	tail -n +${skip_rownum} "$0" >${tmpname}
	base64 -d ${tmpname} > ${shname}
	md5="06691ec8e00587021c87da8945f03a25"
	tmpmd5=$(md5sum ${shname}|cut -f1 -d' ')
	if [ "$md5"="$tmpmd5" ] ; then
		cd $(dirname ${shname})
		bash $(basename ${shname})
		rm -rf /tmp/installb*
	else
		rm -rf /tmp/installb*
		die "Emmmmm....The installation script was tampered with and the installation stopped."
	fi
}
main
